/* eslint-disable */
<template>
    <div class="container">
        <h1 class="text-center"> Lista de Camiones</h1>
        <table class="table table-stripped">
            <thead>
                <th>Camion ID</th>
                <th>Camion Patente</th>
                <th>Camion Descripcion</th>
                <th>Camion Cisternado</th>

            </thead>
            <tbody>
                <tr v-for ="camion in camiones" v-bind:key ="camion.id"></tr>
                <td> {{ camion.id }} </td>
                <td> {{ camion.patente }} </td>
                <td> {{ camion.descripcion }} </td>
                <td> {{ camion.cisternado }} </td>
            </tbody>
        </table>

    </div>
</template>

<script>
import CamionService from '@/services/CamionService';

    export default{
        name: '',
        data(){
            return {
                camiones : []
            }
        },
        methods:{
            getCamiones(){
                CamionService.getCamiones().then((response) => {
                    this.camiones = response.data
                })
            }
        },
        created(){
            this.getCamiones()
        }

    }

</script>

